show_map = function (e) {
    init_setting.show_baidu = false, init_setting.val_format = "p-c-a", selectArea = { "province": "", "city": "", "area": "", "address": "", "add_remark": "", "lng": 0, "lat": 0 }, init_setting.keep_old = true, init_setting.call_back = false, init_setting.show_remark = true, init_setting.readonly = true;
    var userSetting = (new Function("return" + $(e.target).attr("wtmap")))();
    eventEl = $("#" + userSetting.c),
    init_setting.show_baidu = userSetting.bd != null ? userSetting.bd : init_setting.show_baidu,
    init_setting.max_level = userSetting.ml ? userSetting.ml : init_setting.max_level,
    init_setting.val_format = userSetting.f ? userSetting.f : init_setting.val_format,
    init_setting.keep_old = userSetting.o != null ? userSetting.o : init_setting.keep_old,
    init_setting.call_back = userSetting.cb != null ? userSetting.cb : init_setting.call_back,
    init_setting.show_remark = userSetting.ar != null ? userSetting.ar : init_setting.show_remark;
    init_setting.readonly = userSetting.r != null ? userSetting.r : init_setting.readonly;
    nowLevel = 0;
    if (eventEl && eventEl.attr("wtmap-data")) {
        var elData = (new Function("return" + eventEl.attr("wtmap-data")))();
        if (elData.p && elData.p != "") {
            if (init_setting.show_baidu) {
                selectArea.province = elData.p, selectArea.city = elData.c, selectArea.area = elData.a, selectArea.address = elData.d, selectArea.add_remark = elData.dr, selectArea.lng = elData.ln, selectArea.lat = elData.la;
                nowLevel = -1;
            }
            else {
                selectArea.province = elData.p;
                nowLevel = 1;
                if (selectArea.province == "香港" || selectArea.province == "澳门" || selectArea.province == "台湾")
                    nowLevel = 0;
            }
        }
    }
    init_map();
},
set_value = function () {

    if (eventEl) {

        var rightSet = function () {

            var allArea = init_setting.val_format.replace("p", selectArea.province).replace("c", selectArea.city).replace("a", selectArea.area).replace("d", selectArea.address).replace("r", (selectArea.add_remark != "" ? "(" + selectArea.add_remark + ")" : ""));
            if (selectArea.city == "" && !init_setting.show_baidu)
                allArea = selectArea.province;
            eventEl.val(allArea);
            // var isSAR = (selectArea.province == "香港" || selectArea.province == "澳门" || selectArea.province == "台湾");
            if (init_setting.keep_old){
                eventEl.attr("wtmap-data", "{p:'" + selectArea.province + "',c:'" + selectArea.city + "',a:'" + selectArea.area + "',d:'" + selectArea.address + "',dr:'" + selectArea.add_remark + "',ln:'" + selectArea.lng + "',la:'" + selectArea.lat + "'}");
				 eventEl.attr("v-data", selectArea.province+"-"+ selectArea.city+"-"+ selectArea.area );
				 testadddd(eventEl.index());
				 }
            else
                eventEl.removeAttr("wtmap-data");

            //if (!isSAR)
            if (init_setting.call_back && typeof (WTMap_CallBack) != "undefined") {
                WTMap_CallBack(selectArea, eventEl[0]); //回调函数(如存在)
            }

            eventEl.blur();
        }


        if (init_setting.show_baidu) {
            var point = new BMap.Point(selectArea.lng, selectArea.lat);
            geoc.getLocation(point, function (rs) {
                var addComp = rs.addressComponents;
                var newPro = addComp.province.substring(0, 2), newCity = addComp.city.substring(0, 2);
                var oldPro = selectArea.province.substring(0, 2), oldCity = selectArea.city.substring(0, 2);
                if (init_setting.check_drag && (newPro != oldPro || newCity != oldCity)) {
                    alert("您选择的位置与选择的城市不符，请重新选择！");
                    return;
                }
                else {

                    var newWtArea = get_wt_area(addComp);
                    selectArea.province = newWtArea.province;
                    selectArea.city = newWtArea.city;
                    selectArea.area = newWtArea.area;
                    rightSet();

                }
            });

        }
        else {
            rightSet();
        }
    }
},
get_wt_area = function (areaJson) {
    areaJson.province = areaJson.province.substr(0, 2),
    areaJson.city = areaJson.city.substr(0, 2),
    areaJson.area = areaJson.district.substr(0, 2);
    $.ajax({
        type: "POST",
        dataType: "json",
        async: false,
        url: "/Ashx/SendGoodsHandler.ashx?t=" + new Date().getTime(),
        data: { "action": "getarea", "pro": areaJson.province, "city": areaJson.city, "area": areaJson.area },
        success: function (retJson) {
            if (retJson.status == 1) {
                areaJson.province = retJson.pro;
                areaJson.city = retJson.city;
                areaJson.area = retJson.area;
            }
        }
    });
    return areaJson;
},
