    function change_pos() {
        if (initMarker != null) {
            var markerPx = map.pointToPixel(initMarker.point);
            if ($("#WTMap_Main").length > 0) {
                $(".address_footer").width($(".address_group").width());
                $(".address_group").css("left", markerPx.x - $(".address_group").width() / 2 + $("#WTMap_Main").position().left).css("top", markerPx.y - $(".address_group").height() - 20 + $("#WTMap_Main").position().top);
            }


            $(".hiddenOp").hide();
            $(".address_group").show();
        }
    }

    function hidden_tip() {
        if (initMarker != null) {
            var pos = map.pointToPixel(initMarker.point);
            var mapSize = map.getSize();
            change_pos();
            if (pos.x < 0 || pos.y < 0 || pos.x > mapSize.width || pos.y > mapSize.height) {
                var centerPx = map.pointToPixel(map.getCenter());
                if ($("#WTMap_Main").length > 0)
                    $(".hiddenOp").css("left", centerPx.x + $("#WTMap_Main").position().left - 55).css("top", centerPx.y + $("#WTMap_Main").position().top - 25);
                $(".address_group").hide();
                $(".hiddenOp").show();
            }
            else {
                $(".hiddenOp").hide();
                $(".address_group").show();
            }

        }
    }

